sys_variable_value.value:
(function execute(inputs, outputs) {
	var stageArray = inputs.StageDetails.stages;	    
	for (i=0;i<stageArray.length;i++){
		if(stageArray[i].name == "Publication") {
    		outputs.stage_id = stageArray[i]["stage-type-id"];
        }
	}
})(inputs, outputs);

